GetCivico = function(civico)
	if Civici["n" .. civico] ~= nil then 
		return vector3(Civici["n" .. civico].x, Civici["n" .. civico].y, 0.0)	
	end
end

RegisterCommand("gps", function(source, args, raw)
	if #args > 0 then
		if Civici["n" .. args[1]] ~= nil then
			SetNewWaypoint(Civici["n" .. args[1]].x, Civici["n" .. args[1]].y);
            TriggerEvent('Notify', 'successo', 'GPS impostato al civico <b>' .. args[1] .. '</b>, fai /gps per resettare il gps', 5000);
		else 
			TriggerEvent('Notify', 'negato', 'Civico Invalido')
		end
	else 
		SetWaypointOff();
		TriggerEvent('Notify', 'negato', 'GPS Resettato')
	end
end)